        "title": "Buscaminas (Nevron)",
        "description": "**How to Begin:** Speak with Demineur, found inside [Flying Waters](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=448438).  From [Noco's Hut rest point](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=474607), head north into the clearing with the giant anchor.  Continue clockwise around the anchor and then through the circular, vase-like structure in the upper corner   \n\n**Quest Steps:**\n- Examine Demineur, but do not attack them\n- Traverse the platforming challenge and retrieve the [Intact Mine](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=458084)\n- Return to Demineur and give them the Intact Mine\n\n**Rewards:**\n- [Deminerim (Lune)](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=448933) (level 3)\n- Colour of Lumina x3 (Must kill Demineur) \n- Chroma Catalyst (Must kill Demineur)",
