        "description": "**How to Begin:** Find and speak with this tiny Gestral, west through the alley from the Chief House inside the [Gestral Village](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=448439)   \n\n**Quest Steps:**\n- Gain access to [Esquie's Nest](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=448435) by progressing the main story\n- Retrieve the Blue [Mushroom](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=449490) in [Esquie's Nest](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=448435) and give it to Karatom\n- Defeat Karatom's Ultimate Sakapatate in battle! \n\n**Rewards:**\n- Pure (Gustave outfit)\n- Polished Chroma Catalyst x3\n- Recoat\n\n**Note:** This quest cannot be completed after Act I",
