        "id": 457674,
        "map_id": 760,
        "region_id": null,
        "category_id": 12861,
        "title": "Alexsoundro",
        "description": "**How to Begin:** Speak with Alexsoundro, a tall and lanky Gestral standing near the lone column between the giant Sakapatate and the jousting area inside of the [Gestral Village](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=448439)  \n\n**Quest Steps:**\n- Agree to rescue Alexsoundro's [patate](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=475478) \n- Head north toward the Arena \n- Take an immediate right to march down the southeastern path, then take a slight left\n- At the end of the eastern passage, use the [rope](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=475474) to climb onto an overhead platform\n- Next, take a few steps west and use the [grapple point](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=475476) to clear the gap \n- From the other side, go north and [traverse the wall](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=475477) to your left towards the [patate](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=475478)\n- Finally, mantle over the short wall, and with a running start, leap onto the column to reach and speak to the [patate](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=475478)\n\n**Rewards:**\n- [Sakapatate ](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=475479)(Lune outfit)",
