        "category_id": 12861,
        "title": "Hexga (neurona)",
        "description": "**How to Begin:** Start at the Old Farm rest point flag found inside the [Stone Wave Cliffs](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=448434), then head south and take a slight right as you approach the wall to follow the lantern-lined path.  When you reach the top of the hill, take a left, then use the handholds on the right wall to climb toward the Hexga\n\n**Quest Steps:**\n- Enter the nearby cave, use the grapple point to cross the gap, then head east and descend the rope to the lower level\n- Find all three glowing rock crystals in the large underground area:\n  - [Glowing Rock Crystal I](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=458546#L)\n  - [Glowing Rock Crystal II](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=458547#L)\n  - [Glowing Rock Crystal III](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=458548#L)\n- Return to the Hexga and give them the rocks\n- Retrieve your reward from where the Hexga was sitting \n\n**Rewards:**\n- [Auto Shell](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=454681) (Pictos)\n- Colour of Lumina x3 (Must kill Hexga)\n- Polished Chroma Catalyst (Must kill Hexga)\n- Recoat (Must kill Hexga)",
