        "category_id": 12861,
        "title": "Benisseur (neurona)",
        "description": "**How to Begin:** Head south, once inside the [Red Woods](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=448579), and speak with the talking fountain  \n\n**Quest Steps:**\n- You'll need to pay the talking fountain four times in the increments listed below:\n  - Payment 1 - 5,000 Chroma\n  - Payment 2 - 10,000 Chroma\n  - Payment 3 - 25,000 Chroma\n  - Payment 4 - 50,000 Chroma\n- After all four payments (a total of 90,000 Chroma), the Benisseur will pop up and present your reward \n\n**Rewards:**\n- [Recovery](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=452891) (Pictos)\n- Grandiose Chroma Catalyst (Must kill Benisseur)",
