        "category_id": 12861,
        "title": "Trovador (Nevron)",
        "description": "**How to Begin:** Head south, once inside the [Stone Quarry](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=448478), and speak with the Troubadour   \n\n**Quest Steps:**\n- Survive three rounds of Troubadour's playing without getting hit by a red orb, even once. \n- Allow the green orbs to hit you for a small bit of healing \n- In each subsequent round, the Troubadour's playing will get slightly quicker, so it's essential to focus on the end of the Nevron's trumpet to quickly identify whether you need to parry/dodge or let the orb hit you\n- Speak with Troubadour again after completing all 3 rounds for your reward \n\n**Rewards:**\n- [Healing Parry](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=448556) (Pictos)\n- Resplendent Chroma Catalyst (Must kill Troubadour)",
