        "title": "Profesora bailarina (Nevron)",
        "description": "**How to Begin:** After entering [Frozen Hearts](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=448496), walk north of the Icebound Train Station Rest Point, and through the northwestern path left of the train. Next, go left to enter a cave and climb the rope.  On the upper level, turn left to travel southeast, then walk up the short staircase. Finally, follow the train tracks north, then drop down and speak with the Danseuse Teacher.\n\n**Quest Steps:**\n- Progress dialogue with the Teacher until you can select \"Okay... I'm ready\" to begin the challenge\n- You must parry ALL incoming projectiles to perform a counterattack\n- Speak with the Danseuse Teacher again after accomplishing this for your reward \n\n**Rewards:**\n- [Danseuse (Lune)](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=504519)\n- [Augmented Counter III](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=456360) (Pictos) (Must kill Danseuse Teacher)\n- Grandiose Chroma Catalyst x3 (Must kill Danseuse Teacher)\n- Recoat (Must kill Danseuse Teacher)",
