        "description": "**Location:** Found within [Monoco's Station](https://mapgenie.io/clair-obscur-expedition-33/maps/the-continent?locationIds=448427) wearing a red beret.  Answer his questions correctly with each of the three women and he'll reward the Pure Outfit to each:\n- Lune: \n  - Life blooms like a rose, with petals soft and frail... -> Winter winds will whisper, the ending of the tale.\n  - Life's a canvas painted with the colours of our strife... -> Death the artist's final stroke, completing every life.\n  - Life sings a song of joy and pain, its notes both sweet and bitter... -> Its echoes fade to stillness, our secrets follow after.\n- Maelle:\n  - Life is but a fleeting dream, a whisper in the night... -> While shadows fade to silence, gone beyond our sight.\n  - Through the veil of shadows, life's mysteries are spun... -> Death untangles threads, revealing what's begun.  \n  - Life dances on the edge of time, a flicker in the breeze... -> Eternity then cradles us, a promise to appease.\n- Sciel:\n  - Life's a river winding through the valleys of despair... -> It meets the sea's embrace, where sorrow turns to air.\n  - Life's a story written with the ink of dreams and fears... -> And death the final chapter, where we shed our tears.\n  - Life's a blazing comet, racing through the sky... -> Its light will softly fade, where weary skies lie.",
